import React from 'react'

const HelloPropsLoopList = (props) =>{
  const listItems = props.data.map((text, index) => {
    return (
      <dl>
        <dt>{index}</dt>
        <dd>{text}</dd>
      </dl>
    );
  });

  // return (
  //   <div>
  //     {listItems}
  //   </div>
  // );

  return (
    <div>
      {props.data.map((text, index) => {
        return (
        <dl>
          <dt>{index}</dt>
        <dd>{text}</dd>
        </dl>
        );
      })}
    </div>
  );


};

export default HelloPropsLoopList;
